import React from 'react';
import { Link } from 'react-router-dom';
import './'


export function NavBar() {
    return (
        <nav >
        <ul>
        <Link to='/'> 
        <li>iWorld! </li>
        </Link>
        <Link to='/Activities'>
          <li>Actividades</li>
        </Link>
        </ul>
    </nav>
    )
};

export default NavBar
